import React, { useState,useEffect } from "react";


function Deletereq()
{
const [data,setData]=useState([]);
fetch('https://jsonplaceholder.typicode.com/posts').then(res=>res.json()).then(data1=>setData(data1.slice(0,14)))

const deleteFunction=(ID)=>{
  fetch(`https://jsonplaceholder.typicode.com/posts`+ID,{
    method:'post',
  })
}

return(
    <>
    <table>
        <tr>
            <th>ID</th>
            <th>TITLE</th>
            <th>BODY</th>
            <th>DELETE</th>
        </tr>
        {
        data.map(filtered=>
           <>
           <tr>
            <td>{filtered.id}</td>
            <td>{filtered.title}</td>
            <td>{filtered.body}</td>
            <td><button onClick={()=>deleteFunction(filtered.id)}>Delete</button></td>
           </tr>
           </> )
        }
    </table>
    </>
)
}
export default  Deletereq;
